import React from "react";

export default function KeyBoard() {
  return (
    <div>
        <KeyGrid1 />
    </div>
  );
}

function KeyGrid1(){
    <div className="key-grid">
      {Array.from({ length: 2 }, (_, i) => i + 1).map((i) => {
        return <Key code={i} key={i} />;
      })}
    </div>
}

function Key({ code }) {
  return (
    <>
      <p className={`item ${code === 9 || code ===  18 ? "break" : ""}`}>{code}</p>
    </>
  );
}
